/**
 * Multiply two numbers
 * 
 * To perform arithmetic multiplication of two numerical inputs
 *
 * @param factor_one - Parameter of type number
 * @param factor_two - Parameter of type number
 * @returns number
 */
export function multiply_numbers(factor_one: number, factor_two: number): number {
  let product: number;

  // Multiply factor_one and factor_two and store the result in product
  product = factor_one * factor_two
  // Return the product of factor_one and factor_two
  return product
}
